import './App.css';
import { Routes, Route } from 'react-router-dom'
import Home from './Components/ComponentBasic/Home'
import About from './Components/ComponentBasic/About'
import Navbar from './Components/ComponentBasic/NavBar'

function App() {
  return (
    <div className="App">
      <>
      <NavBar />
      <Routes>
        <Route path='/' element={<Home />} />
        <Route path='/about' element={<About />} />
      </Routes>
      </>
    </div>
  );
}

export default App;
